import React, {Component} from 'react';
import PropTypes from 'prop-types';

class Cart extends Component {
  render () {
    const counter = this.props.myStore.getState();
    console.log(counter);
    return (
      <div id="cart">
        {this.props.cart} Items - Component Cart
      </div>
    );
  }
}
Cart.propTypes = {
  myStore: PropTypes.object,
};
export default Cart;
